INSERT INTO `dle_static` VALUES (1,'dle-rules-page','Общие правила на сайте','<b>Общие правила поведения на сайте:</b><br><br>Начнем с того, что на сайте общаются сотни людей, разных религий и взглядов, и все они являются полноправными посетителями нашего сайта, поэтому если мы хотим чтобы это сообщество людей функционировало нам и необходимы правила. Мы настоятельно рекомендуем прочитать настоящие правила, это займет у вас всего минут пять, но сбережет нам и вам время и поможет сделать сайт более интересным и организованным.<br><br>Начнем с того, что на нашем сайте нужно вести себя уважительно ко всем посетителям сайта. Не надо оскорблений по отношению к участникам, это всегда лишнее. Если есть претензии - обращайтесь к Админам или Модераторам (воспользуйтесь личными сообщениями). Оскорбление других посетителей считается у нас одним из самых тяжких нарушений и строго наказывается администрацией. <b>У нас строго запрещен расизм, религиозные и политические высказывания.</b> Заранее благодарим вас за понимание и за желание сделать наш сайт более вежливым и дружелюбным.<br><br><b>На сайте строго запрещено:</b> <br><br>- сообщения, не относящиеся к содержанию статьи или к контексту обсуждения<br>- оскорбление и угрозы в адрес посетителей сайта<br>- в комментариях запрещаются выражения, содержащие ненормативную лексику, унижающие человеческое достоинство, разжигающие межнациональную рознь<br>- спам, а также реклама любых товаров и услуг, иных ресурсов, СМИ или событий, не относящихся к контексту обсуждения статьи<br><br>Давайте будем уважать друг друга и сайт, на который Вы и другие читатели приходят пообщаться и высказать свои мысли. Администрация сайта оставляет за собой право удалять комментарии или часть комментариев, если они не соответствуют данным требованиям.<br><br>При нарушении правил вам может быть дано <b>предупреждение</b>. В некоторых случаях может быть дан бан <b>без предупреждений</b>. По вопросам снятия бана писать администратору.<br><br><b>Оскорбление</b> администраторов или модераторов также караются <b>баном</b> - уважайте чужой труд.<br><br><div style=\"text-align:center;\">{ACCEPT-DECLINE}</div>',1,1,'all','','Общие правила','Общие правила',309,'',1656833738,'',1,1,0,0,''),(2,'ocompani','О компании','ocompani',0,1,'all','ocompani','О компании Akiba Auto','ocompani',6217,'',1656834666,'О компании',1,1,0,0,''),(3,'contact','Контакты','contact',0,1,'all','contact','Контактная информация Akiba Auto','contact',9965,'',1656834681,'Контакты',1,1,0,0,''),(4,'catalog-jp','Каталог выгодных автомобилей из Японии','catalog-jp',0,1,'all','catalog-jp','Каталог выгодных автомобилей из Японии','catalog-jp',12064,'',1656834705,'Каталог выгодных автомобилей из Японии',1,1,0,0,''),(5,'sogl','Пользовательское соглашение','1',0,1,'all','sogl','Пользовательское соглашение Настоящее пользовательское соглашение (далее – Соглашение) определяет условия использования Пользователями','Соглашения, Сайта, Пользователя, «АКИБА, ГРУПП», Сайте, Соглашение, данные, ответственности, новой, Пользователей, Пользователем, законодательством, материалов, органов, использования, Российской',38,'template',1656901893,'1',1,1,0,0,''),(6,'konf','1','1',0,1,'all','konf','1','1',3,'',1656902248,'1',1,1,0,0,''),(7,'oplata','Процесс покупки','oplata',0,1,'all','oplata','oplata','oplata',6723,'',1658062222,'oplata',1,1,0,0,''),(8,'catalog-kr','catalog-kr','catalog-kr',0,1,'all','catalog-kr','catalog-kr','catalog-kr',34369,'',1658859070,'catalog-kr',1,1,0,0,'');
